import Logo2 from "../../../assets/img2.png";
import { ThemeDiv, ThemeHeader } from "./style";
import { FiMenu } from "react-icons/fi";
import { FiHome } from "react-icons/fH";
import { BiUserCircle } from "react-icons/bC";
import { VscBook } from "react-icons/vscBook";
import { MdInsertInvitation } from "react-icons/mdInsertInvitation";
import { FiMail } from "react-icons/fiMail";

const HeaderModal = ({ closeModal }) => {
  return (
    <>
      <ThemeHeader w="100%" h="100px" bc="#68DAD8" j="space-between" a="center">
        <img src={Logo2} alt="Logo" />
        <FiMenu onClick={() => closeModal} className="button1" />
      </ThemeHeader>
      <ThemeDiv>
        <ThemeDiv a="center">
          <img src={FiHome} alt="Home" /> <h2>Home</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src={BiUserCircle} alt="Login" /> <h2>Login</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src={VscBook} alt="Cadastrar escola" /> <h2>Cadastrar escola</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src={MdInsertInvitation} alt="Eventos" /> <h2>Eventos</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src={FiMail} alt="Email para contato" /> <h2>Email para contato</h2>
        </ThemeDiv>
      </ThemeDiv>
    </>
  );
};

export default HeaderModal;
